const Footer = () => {
    return(
        <div>
            <div className= "footer-box">
                <div className= "quick-links">
                Quick Links
                </div>
                <div className= "service-links">
                Services
                </div>
                <div className= "contact">
                Contact
                </div>
                <div className= "quick-links-inner">
                Home 
                <br/>
                About 
                <br/>
                Success
                <br/> 
                Stories
                <br/> 
                Insights
                <br/> 
                Career
                <br/> 
                Contact
                </div>
                <div className= "service-inner">
                Open Source Implementation 
                <br/>
                Scala Programming
                <br/> 
                Restful API'S 
                <br/>
                Automated Devops Deployment 
                <br/>
                Big Data Analytics 
                <br/>
                Native Apps Building 
                </div>
            </div>
    <style jsx>{`
    
    .footer-box {
        position: absolute;
        width: 1344px;
        height: 434px;
        left: 0px;
        top: 5415px;
        background: #000000;
    }

    .quick-links {
        position: absolute;
        width: 125px;
        height: 28px;
        left: 54px;
        top: 88px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 500;
        font-size: 24px;
        line-height: 28px;
        color: #FFFFFF;
    }

    .service-links {
        position: absolute;
        width: 125px;
        height: 28px;
        left: 366px;
        top: 88px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 500;
        font-size: 24px;
        line-height: 28px;
        color: #FFFFFF;
    }

    .contact {
        position: absolute;
        width: 125px;
        height: 28px;
        left: 1004px;
        top: 88px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 500;
        font-size: 24px;
        line-height: 28px;
        color: #FFFFFF;
    }

    .quick-links-inner {
        position: absolute;
        width: 129px;
        height: 186px;
        left: 54px;
        top: 146px;
        font-family: Roboto;
        font-style: normal;
        font-weight: normal;
        font-size: 18px;
        line-height: 170%;
        color: #EBEBEB;
    }

    .service-inner {
        position: absolute;
        width: 258px;
        height: 186px;
        left: 366px;
        top: 246px;
        font-family: Roboto;
        font-style: normal;
        font-weight: normal;
        font-size: 18px;
        line-height: 170%;
        color: #EBEBEB;
    }
    `}</style>
        </div>
    )
}

export default Footer
